import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Login from './Login';
import Register from './Register';
import Nav from './Nav';
import EventPage from './EventPage';
import { UserProvider } from './UserContext'; // Make sure the path is correct
import NewEvent from './NewEvent';
function App() {
  const addToCart = (eventData) => {
    console.log('Added to Cart:', eventData);
    // Add logic to update the cart state or perform other actions
  };

  return (
    <Router>
      <UserProvider>
        <Routes>
          <Route path="/Login" element={<Login />} />
          <Route path="/Register" element={<Register />} />
          <Route path="/Nav" element={<Nav addToCart={addToCart} />} />
          <Route path="/EventPage" element={<EventPage addToCart={addToCart} />} />
          <Route path="/Register" element={<Register />} />

        </Routes>
      </UserProvider>
    </Router>
  );
}

export default App;
